def b(text):
    return f"\033[1m{text}\033[0m"
     


def puts(col1, col2):
    delimiter = 4*" "
    print(b(col1), delimiter, b(col2))



def get_cpu_load():
    with open('/proc/loadavg', 'r') as f:
        load_avg = f.readline().strip().split()[:3]
    return tuple(float(x) for x in load_avg)

def get_ram_usage():
    with open('/proc/meminfo', 'r') as f:
        lines = f.readlines()
    mem_total = int(lines[0].split()[1])
    mem_free = int(lines[1].split()[1])
    mem_available = int(lines[2].split()[1])
    return mem_total, mem_free, mem_available

def get_os_name():
    return platform.system()

def get_kernel_version():
    return platform.release()

def get_shell():
    return os.environ.get('SHELL')

def get_desktop_environment():
    # Check common environment variables for desktop environment
    desktop_session = os.environ.get('DESKTOP_SESSION')
    if desktop_session:
        if desktop_session == 'ubuntu':
            return 'GNOME'
        return desktop_session
    elif os.environ.get('GNOME_DESKTOP_SESSION_ID'):
        return 'GNOME'
    elif os.environ.get('KDE_FULL_SESSION'):
        return 'KDE'
    elif os.environ.get('XDG_CURRENT_DESKTOP'):
        return os.environ.get('XDG_CURRENT_DESKTOP')
    else:
        return 'Unknown'



def neolain():

    cpu_load = get_cpu_load()
    mem_total, mem_free, mem_available = get_ram_usage()
    os_name = get_os_name()
    kernel_version = get_kernel_version()
    shell = get_shell()
    desktop_environment = get_desktop_environment()
    
    new_img = LAIN.split("\n")
    load = [
        f"‚¨• CPU:{cpu_load[1]}",
        f"‚¨• Total RAM: {int(mem_total/1024)} MB",
        f"‚¨• Free RAM: {int(mem_free/1024)} MB",
        f"‚¨• Available RAM: {int(mem_available/1024)} MB",
        f"‚¨• OS Name: {os_name}",
        f"‚¨• Kernel Version: {kernel_version}",
        f"‚¨• Shell: {shell}",
        f"‚¨• Desktop Environment: {desktop_environment}",
        "", "",
        "‚ò∫  ‚òª  ‚ô•  ‚ô¶  ‚ô£  ‚ô†  ‚Ä¢  ‚óò",
        "‚óã  ‚óô  ‚ôÇ  ‚ôÄ  ‚ô™  ‚ô´  ‚òº  ‚ñ∫",
        "‚óÑ  ‚Üï  ‚Äº  ¬∂  ¬ß  ‚ñ¨  ‚Ü®  ‚Üë",
        "‚Üì  ‚Üí  ‚Üê  ‚àü  ‚Üî  ‚ñ≤  ‚ñº   ",
    ]
    
    counter = 0
    while counter < len(new_img):
        if counter < 2:
            print(new_img[counter])
        elif counter < len(load):
            puts(new_img[counter], load[counter])
        else:
            print(new_img[counter])
        counter += 1
    print("\n")

